$.getJSON("https:\/\/releases.admin.aspose.com/api/updatecount?path=d30743f69aaf443ea0233fd23c9b39a7&single=1", function(data) { $.each(data, function(key, value) {
$("#dwn-update-"+ key).css({"background":"none"});
$("#dwn-update-"+ key).css({"color":"#333"});
$("#dwn-update-"+ key).text(value.download_count);
$("#added-update-"+ key).text(value.date_added);
});
});
